import React from 'react';

const Register = ({ unameRef, pwordRef, handleRegister }) => {
  return (
    <div>
      <h1>Register</h1>
      <div>
        Username <input type="text" ref={unameRef} />
      </div>
      <div>
        Password <input type="password" ref={pwordRef} />
      </div>
      <div>
        <button onClick={handleRegister}>Register</button>
      </div>
      <div>
        <a href="/login">Already have an account? Login here</a>
      </div>
    </div>
  );
};

export default Register;
